|Game Description|
+----------------+

Grab your cart and start smashing bricks to release shiny gems. Form different shapes with bricks to receive even greater treasures and make your way through the thick jungle. Exotic lands await the brave explorer!

+----------------------------------+
|Instructions / System Requirements|
+----------------------------------+

No install or crack is required for this portable version. Extract the ZIP file and create a shortcut to the executable (EXE) to play.

- Win 2000/XP/Vista

- Pentium III processor speed

- RAM: 128 MB

- Graphics Card: 3D acceleration recommended

- DirectX version: 5.0

